B.MS=new A.bX(B.vs,["Log In","Parking Management System","MOWIZ","EYPSA","Username","Password","Log In","Invalid credentials","Invalid credentials","Welcome","Select Zone","Extend Session","Next","\u20ac/h","max {hours}h","License Plate","Ex: 1234ABC","Clear","Back","Next","Invalid format. Use: 1234ABC","Valid plate","Parking Time","Valid until","Total","+","\u2212","Go to Payment","Quick Select","Payment","Coins","Chip+PIN","Contactless","Inserted","Remaining","Pay Now","Cancel","Authorizing...","Authorized","New Parking","Extend Session","Zone","Duration","Total","Select Method","Insert Coins","Parking Registered","Extension Completed","Print Ticket","OK","New Parking","Details","License Plate","Zone","Start","End","Amount","Previous end","New end","Extra amount","Accessibility","Dark Mode","High Contrast","Text Size","Small","Normal","Large","Adjust text size","Text Size allows you to adjust the size of all letters in the application. You can choose between Small (for large screens), Normal (standard size) or Large (for better readability). This affects buttons, titles, descriptions and all interface texts.","Reduce Animations","Reduce animations for better performance","Reduce Animations disables or simplifies application transitions and visual effects, improving performance on slower devices and reducing visual fatigue for users sensitive to movement. Screens will change more directly and quickly.","Switch between light and dark theme","Dark Mode changes the application theme to dark colors, reducing eye strain in low-light conditions. Backgrounds become dark and text becomes light, providing better contrast and comfort for the eyes.","Increase contrast for better visibility","High Contrast significantly increases the difference between text and background colors, improving readability for users with vision problems. Text becomes sharper and easier to read.","Voice Guide","Voice-assisted navigation","Voice Guide provides audio instructions for each screen and action, helping users with visual impairments or those who prefer voice navigation. The application will automatically speak available options and confirm performed actions.","Voice Speed","Adjust speech speed","Voice Speed controls how fast the voice guide speaks. You can adjust it from very slow (10%) to very fast (100%) according to your preference and comprehension ability.","Voice Pitch","Adjust speech pitch","Voice Pitch adjusts the pitch of the voice guide. You can make it deeper (0.5x) or higher (2.0x) according to your auditory preference.","Voice Volume","Adjust speech volume","Voice Volume controls how loud the voice guide sounds. You can adjust it from silent (0%) to maximum volume (100%) according to ambient noise and your preference.","Adaptive AI","Learns from your behavior and adapts automatically","Adaptive AI learns from how you use the application and automatically adjusts accessibility settings. For example, if you frequently use voice guidance, it will enable it automatically. If you prefer large buttons, it will increase font size. The AI will also remember your preferred zones and suggest faster options.","Simplified Mode","Ultra-simple interface with fewer options","Simplified Mode reduces interface complexity by showing only essential options. Buttons are larger, text is clearer, and steps are more direct. Ideal for users who prefer a simpler and more direct experience.","Apply","Back","SELECT ZONE","Select a parking zone by touching the screen. On the next screen you will need to enter your vehicle license plate.","Zone selected. Please proceed to enter your license plate.","ENTER LICENSE PLATE","Enter your vehicle license plate using the format of four numbers followed by three letters. For example: 1234ABC.","Valid license plate. Please proceed to select parking time.","Invalid license plate format. Please use the correct format.","SELECT TIME","Select parking time using the plus and minus buttons. The price will be calculated automatically.","Time selected. Please proceed to payment.","MAKE PAYMENT","Select your preferred payment method: coins, chip and PIN card, or contactless payment.","Insert the necessary coins to complete the payment.","Insert your card and follow the on-screen instructions.","Bring your card or mobile device close to the reader.","Payment completed. Your ticket is being generated.","TICKET GENERATED","Your parking ticket has been generated. Please place it visibly on your vehicle windshield.","Valid until the time indicated on the ticket.","Thank you for using MEYPARK. Have a great trip!","Language","Espa\xf1ol (Espa\xf1a)","English","Save","Cancel","Admin Access","Password","Access","Cancel","Incorrect password","Tech Access","Password","Enter","Cancel","Incorrect password","Tech Mode","System Status","Refresh","Diagnostics","Counters","Configuration","Actions","Display Test","Touch Test","Printer Test","Coins Test","Card Test","Reset Day","Force Reload","Reboot App","Close","Network","Printer","Coin Acceptor","Card Reader","Temperature","Door","Transactions today","Cash income","Card income","Last sync","Active operator","Extend Session","Search","No active session for this license plate","Back to Zones","Start New","Current end","Remaining time","Extra time","New end","Extra amount","Go to Payment","Maximum time reached","Loading...","Error","Success","Confirm","Yes","No","OK","Cancel","Save","Back","Next","Finish"],t.li)
